import React from "react";
import { Container } from "react-bootstrap";

let cartMovies = () => {
    return (
        <div className="wrapper-Movies">
            <div className="cart">
                    <img src="../images/moviesImg.jpg"/>
                    <div></div>
            </div>
        </div>
    )
}

export default cartMovies
